INSERT INTO `OpenStackComponent` (`ID`,`ClassName`,`Created`,`LastEdited`,`Name`,`CodeName`,`Description`,`SupportsVersioning`,`SupportsExtensions`,`IsCoreService`,`IconClass`,`Use`,`HasStableBranches`,`WikiUrl`,`TCApprovedRelease`,`HasTeamDiversity`,`IncludedComputeStarterKit`,`VulnerabilityManaged`,`Order`,`LatestReleasePTLID`,`YouTubeID`,`VideoDescription`,`VideoTitle`,`FollowsStandardDeprecation`,`SupportsUpgrade`,`SupportsRollingUpgrade`,`Name_en_US`,`Name_fr_FR`,`Name_es_ES`,`Name_de_DE`,`Name_th_TH`,`Name_zh_CN`,`Name_ja_JP`,`Name_ko_KR`,`Description_en_US`,`Description_fr_FR`,`Description_es_ES`,`Description_de_DE`,`Description_th_TH`,`Description_zh_CN`,`Description_ja_JP`,`Description_ko_KR`,`MascotClass`,`ShowOnMarketplace`) VALUES (5,'OpenStackComponent','2014-04-29 09:32:55','2017-04-25 11:01:13','Block Storage','Cinder','Cinder is a Block Storage service for OpenStack. It virtualizes the management of block storage devices and provides end users with a self service API to request and consume those resources without requiring any knowledge of where their storage is actually deployed or on what type of device. This is done through the use of either a reference implementation (LVM) or plugin drivers for other storage. ',1,1,1,'fa-archive','Storage, Backup & Recovery',1,'https://wiki.openstack.org/wiki/Cinder',0,1,0,1,5,19313,'wRphXGU9VLQ',NULL,'Newton Design Series: Cinder',1,1,1,'Block Storage',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Cinder is a Block Storage service for OpenStack. It virtualizes the management of block storage devices and provides end users with a self service API to request and consume those resources without requiring any knowledge of where their storage is actually deployed or on what type of device. This is done through the use of either a reference implementation (LVM) or plugin drivers for other storage. ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Cinder',1);
