vents to end users and to communicate with guest agents that run in the "over-cloud" layer. Cloud operators can leverage Zaqar to provide equivalents of SQS and SNS to their customers.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Barbican',1);
