INSERT INTO `OpenStackComponent` (`ID`,`ClassName`,`Created`,`LastEdited`,`Name`,`CodeName`,`Description`,`SupportsVersioning`,`SupportsExtensions`,`IsCoreService`,`IconClass`,`Use`,`HasStableBranches`,`WikiUrl`,`TCApprovedRelease`,`HasTeamDiversity`,`IncludedComputeStarterKit`,`VulnerabilityManaged`,`Order`,`LatestReleasePTLID`,`YouTubeID`,`VideoDescription`,`VideoTitle`,`FollowsStandardDeprecation`,`SupportsUpgrade`,`SupportsRollingUpgrade`,`Name_en_US`,`Name_fr_FR`,`Name_es_ES`,`Name_de_DE`,`Name_th_TH`,`Name_zh_CN`,`Name_ja_JP`,`Name_ko_KR`,`Description_en_US`,`Description_fr_FR`,`Description_es_ES`,`Description_de_DE`,`Description_th_TH`,`Description_zh_CN`,`Description_ja_JP`,`Description_ko_KR`,`MascotClass`,`ShowOnMarketplace`) VALUES (21,'OpenStackComponent','2017-03-13 10:24:52','2017-04-25 11:00:02','Computable Object Store','Storlets','Openstack Storlets is an extension to Openstack Swift with the ability to run user defined computations - called storlets - inside the object store in a secure and isolated manner through the use of Docker containers. A storlet is a compiled and packaged code (e.g. a .jar file) that can be uploaded to Swift as any other object. Once uploaded the storlet can be invoked over data objects in Swift.',0,0,1,'fa-cogs','Compute',0,'https://wiki.openstack.org/wiki/Storlets',0,0,0,0,21,18526,NULL,NULL,NULL,0,0,0,'Computable Object Store',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Openstack Storlets is an extension to Openstack Swift with the ability to run user defined computations - called storlets - inside the object store in a secure and isolated manner through the use of Docker containers. A storlet is a compiled and packaged code (e.g. a .jar file) that can be uploaded to Swift as any other object. Once uploaded the storlet can be invoked over data objects in Swift.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Storlets',1);
INSERT INTO `OpenStackComponent` (`ID`,`ClassName`,`Created`,`LastEdited`,`Name`,`CodeName`,`Description`,`SupportsVersioning`,`SupportsExtensions`,`IsCoreService`,`IconClass`,`Use`,`HasStableBranches`,`WikiUrl`,`TCApprovedRelease`,`HasTeamDiversity`,`IncludedComputeStarterKit`,`VulnerabilityManaged`,`Order`,`LatestReleasePTLID`,`YouTubeID`,`VideoDescription`,`VideoTitle`,`FollowsStandardDeprecation`,`SupportsUpgrade`,`SupportsRollingUpgrade`,`Name_en_US`,`Name_fr_FR`,`Name_es_ES`,`Name_de_DE`,`Name_th_TH`,`Name_zh_CN`,`Name_ja_JP`,`Name_ko_KR`,`Description_en_US`,`Description_fr_FR`,`Description_es_ES`,`Description_de_DE`,`Description_th_TH`,`Description_zh_CN`,`Description_ja_JP`,`Description_ko_KR`,`MascotClass`,`ShowOnMarketplace`) VALUES (22,'OpenStackComponent','2017-03-13 10:25:41','2017-04-25 11:00:02','Container Management Service','Zun','Zun provides an OpenStack API for launching and managing containers backed by different container technologies. Different from Magnum, Zun is for users who want to treat containers as OpenStack-managed resource. Containers managed by Zun are supposed to be integrated well with other OpenStack resources, such as Neutron network and Cinder volume. Users are provided a simplified APIs to manage containers without the need to explore the complexities of different container technologies.',0,0,1,'fa-cogs','Compute',0,'https://wiki.openstack.org/wiki/Zun',0,1,0,0,22,38440,NULL,NULL,NULL,0,0,0,'Container Management Service',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Zun provides an OpenStack API for launching and managing containers backed by different container technologies. Different from Magnum, Zun is for users who want to treat containers as OpenStack-managed resource. Containers managed by Zun are supposed to be integrated well with other OpenStack resources, such as Neutron network and Cinder volume. Users are provided a simplified APIs to manage containers without the need to explore the complexities of different container technologies.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Zun',1);
