INSERT INTO `OpenStackComponent` (`ID`,`ClassName`,`Created`,`LastEdited`,`Name`,`CodeName`,`Description`,`SupportsVersioning`,`SupportsExtensions`,`IsCoreService`,`IconClass`,`Use`,`HasStableBranches`,`WikiUrl`,`TCApprovedRelease`,`HasTeamDiversity`,`IncludedComputeStarterKit`,`VulnerabilityManaged`,`Order`,`LatestReleasePTLID`,`YouTubeID`,`VideoDescription`,`VideoTitle`,`FollowsStandardDeprecation`,`SupportsUpgrade`,`SupportsRollingUpgrade`,`Name_en_US`,`Name_fr_FR`,`Name_es_ES`,`Name_de_DE`,`Name_th_TH`,`Name_zh_CN`,`Name_ja_JP`,`Name_ko_KR`,`Description_en_US`,`Description_fr_FR`,`Description_es_ES`,`Description_de_DE`,`Description_th_TH`,`Description_zh_CN`,`Description_ja_JP`,`Description_ko_KR`,`MascotClass`,`ShowOnMarketplace`) VALUES (42,'OpenStackComponent','2017-03-13 10:55:58','2017-04-25 11:00:02','Load Balancer','Octavia','Octavia is an open source, operator-scale load balancing solution designed to work with OpenStack. Octavia was borne out of the Neutron LBaaS project, and starting with the Liberty release of OpenStack, Octavia has become the reference implementation for Neutron LBaaS version 2. Octavia accomplishes its delivery of load balancing services by managing a fleet of virtual machines, containers, or bare metal servers—collectively known as amphorae— which it spins up on demand. This on-demand, horizontal scaling feature differentiates Octavia from other load balancing solutions, thereby making Octavia truly suited “for the cloud.”',0,0,1,'fa-cogs','Networking & Content Delivery',1,'https://wiki.openstack.org/wiki/Octavia',0,1,0,0,42,19175,NULL,NULL,NULL,0,0,0,'Load Balancer',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Octavia is an open source, operator-scale load balancing solution designed to work with OpenStack. Octavia was borne out of the Neutron LBaaS project, and starting with the Liberty release of OpenStack, Octavia has become the reference implementation for Neutron LBaaS version 2. Octavia accomplishes its delivery of load balancing services by managing a fleet of virtual machines, containers, or bare metal servers—collectively known as amphorae— which it spins up on demand. This on-demand, horizontal scaling feature differentiates Octavia from other load balancing solutions, thereby making Octavia truly suited “for the cloud.”',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Octavia',0);
