INSERT INTO `OpenStackComponent` (`ID`,`ClassName`,`Created`,`LastEdited`,`Name`,`CodeName`,`Description`,`SupportsVersioning`,`SupportsExtensions`,`IsCoreService`,`IconClass`,`Use`,`HasStableBranches`,`WikiUrl`,`TCApprovedRelease`,`HasTeamDiversity`,`IncludedComputeStarterKit`,`VulnerabilityManaged`,`Order`,`LatestReleasePTLID`,`YouTubeID`,`VideoDescription`,`VideoTitle`,`FollowsStandardDeprecation`,`SupportsUpgrade`,`SupportsRollingUpgrade`,`Name_en_US`,`Name_fr_FR`,`Name_es_ES`,`Name_de_DE`,`Name_th_TH`,`Name_zh_CN`,`Name_ja_JP`,`Name_ko_KR`,`Description_en_US`,`Description_fr_FR`,`Description_es_ES`,`Description_de_DE`,`Description_th_TH`,`Description_zh_CN`,`Description_ja_JP`,`Description_ko_KR`,`MascotClass`,`ShowOnMarketplace`) VALUES (45,'OpenStackComponent','2017-03-13 10:57:27','2017-04-25 11:00:02','Workflow service','Mistral','Mistral is a workflow service. Most business processes consist of multiple distinct interconnected steps that need to be executed in a particular order in a distributed environment. One can describe such process as a set of tasks and task relations (via YAML-based language) and upload such description to Mistral so that it takes care of state management, correct execution order, parallelism, synchronization and high availability.',0,0,1,'fa-cogs','Security, Identity & Compliance',0,'https://wiki.openstack.org/wiki/Mistral',0,1,0,0,45,3672,NULL,NULL,NULL,0,0,0,'Workflow service',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Mistral is a workflow service. Most business processes consist of multiple distinct interconnected steps that need to be executed in a particular order in a distributed environment. One can describe such process as a set of tasks and task relations (via YAML-based language) and upload such description to Mistral so that it takes care of state management, correct execution order, parallelism, synchronization and high availability.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Barbican',0);
